    const[airportvalue, setairportvalue]=useState("");
    useEffect(()=>{
        const fetchData = async ()=>{
            try{
                const response = await fetch('https://iatacodes-iatacodes-v1.p.rapidapi.com/api/v9/suggest')
                if(!response.ok){
                    throw new Error("failed to get data")

                }
                const result =  await response.json()
                setairports(result["airports"])
            }
            catch(error){
                console.log(error)
            }
        }
    },[])
